import { ReactElement, JSXElementConstructor, ReactNode, ReactPortal } from 'react';
import styled from 'styled-components'

interface linkProps {
  isPrimary?: boolean;
  className?: string | undefined, 
  children?: string | number | boolean | undefined, 
  currentPage?:string | number, 
}

// Create a Wrapper component that'll render a <section> tag with some styles
export const Wrapper = styled.div`
  padding: 0 5vw 5vw;
`;

// export const StyledLink = styled(Link)`
//   color: #BF4F74;
//   font-weight: bold;
// `;

const HoverPrimaryNav  = `
  border:1px solid red;
  display:block;
  cursor:pointer;
`;

export const StyledNavLink =  styled.span<linkProps>`
  background: ${props => props.isPrimary ? "blue" : "red"};
  border:1px solid red;
  ${HoverPrimaryNav};
  &:hover{
      background-color:red;
    }
`;

export const InternaLink = styled.span`
  padding:5px;
  background: ${props => props.$primarylink ? "blue" : "red"};
  display: ${props => props.$firstpage === 0 ? "none" : ""};
`;


const Link = (className, children , currentPage : linkProps) => (
  <a className={className} href={`/plp?page=${currentPage}`}>
    {children}
  </a>
);

export const StyledLink = styled(Link)`
  color: #BF4F74;
  font-weight: bold;
`;

const HoverPrimaryBav  = `
  border:1px solid red;
  display:block;
  cursor:pointer;
`;
